import React from 'react'
import { useState, useEffect } from 'react'

// useEffect is used for fetching data in realtime while components is running
const Home = () => {
  const [message, setMessage] = useState()

  useEffect(() => {
    fetch('/').then(response => response.json()) // return json object in backend
    .then(data=>setMessage(data.message))
  }, []); // return only 1 output in use effect

  return (
    <div>{message}</div>
  )
}

export default Home
